const OutputWindow = ({graph}) => {

    if (graph.links && graph.nodes){
        const divRef = useRef(null);
        const { height, width} = useDimensions(divRef, graph);
        return (
            <Box sx={{p: 8}}>
                <Box style={{backgroundColor: "#F2F1F1"}} ref={useRef}>
                        <NetworkDiagramGenerator graph={graph} width={width} height={height}/>
